import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [userdata, setUserData] = useState([
    {
      name: '',
      email: '',
      phone: '',
      password: '',
    },
  ]);
  //connecting to server
  useEffect(() => {
    fetch('http://localhost:8000/')
      .then((res) => res.json())
      .then(
        (result) => {
          setUserData(result);
        },
        (error) => {
          console.log(`Error occured: ${error}`);
        }
      );
  }, []);
  return (
    <div>
      {userdata.map((f) => (
        <li>{f}</li>
      ))}
    </div>
  );
}

export default App;
